import React from "react"
import * as Mui from "@mui/material"

function Post({data}) {
    return(
        <div>
            <h3>{data.title}</h3>
            <p>{data.description}</p>
            <Mui.Button variant="contained" color="secondary">Edit</Mui.Button>
            <Mui.Button variant="contained" color="error">Delete</Mui.Button>
        </div>
    )
}

export default Post
